import React, { Component } from 'react'
import "./contact.css";

class contact extends Component {
    constructor(props) {
        super(props);


        this.state = {
            username:"",
        };
    }
    HandleUsernameChange = (event) => {
        this.setState ({})
    }
    render() {
        return (
            <form>

            <div>

                <label>Usermane</label>
                <input type="text" 
                value={this.state.username}
                onchange={this.HandleUsernameChange} 

                />

            </div>

            </form>
        )
    }
}

export default contact
